import React, { useEffect } from 'react';
import { Bell, BellOff, ExternalLink, Trash2 } from 'lucide-react';
import { useData } from '../contexts/DataContext';
import { useAuth } from '../contexts/AuthContext';

const NotificacoesModule = () => {
  const { notificacoes, updateNotificacao } = useData();
  const { user } = useAuth();
  
  const userNotificacoes = notificacoes
    .filter(n => !n.corretorId || n.corretorId === user?.id)
    .sort((a, b) => new Date(b.data).getTime() - new Date(a.data).getTime());

  const unreadCount = userNotificacoes.filter(n => !n.lida).length;

  const markAsRead = (id: string) => {
    updateNotificacao(id, { lida: true });
  };

  const markAllAsRead = () => {
    userNotificacoes.forEach(notificacao => {
      if (!notificacao.lida) {
        updateNotificacao(notificacao.id, { lida: true });
      }
    });
  };

  const formatDate = (dateString: string) => {
    const date = new Date(dateString);
    const now = new Date();
    const diffInHours = Math.floor((now.getTime() - date.getTime()) / (1000 * 60 * 60));
    
    if (diffInHours < 1) {
      return 'Agora mesmo';
    } else if (diffInHours < 24) {
      return `${diffInHours}h atrás`;
    } else {
      return date.toLocaleDateString('pt-BR', {
        day: '2-digit',
        month: '2-digit',
        year: 'numeric',
        hour: '2-digit',
        minute: '2-digit'
      });
    }
  };

  // Reproduzir som para notificações não lidas
  useEffect(() => {
    const playNotificationSound = () => {
      const audio = new Audio('data:audio/wav;base64,');
      audio.volume = 0.3;
      audio.play().catch(() => {
        // Silently fail if audio can't be played
      });
    };

    if (unreadCount > 0) {
      playNotificationSound();
    }
  }, [unreadCount]);

  return (
    <div className="space-y-6">
      <div className="flex flex-col sm:flex-row justify-between items-start sm:items-center gap-4">
        <div>
          <h2 className="text-2xl font-bold text-gray-900 dark:text-white">Notificações</h2>
          {unreadCount > 0 && (
            <p className="text-sm text-gray-600 dark:text-gray-400">
              {unreadCount} não lida{unreadCount > 1 ? 's' : ''}
            </p>
          )}
        </div>
        {unreadCount > 0 && (
          <button
            onClick={markAllAsRead}
            className="flex items-center px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
          >
            <BellOff className="w-5 h-5 mr-2" />
            Marcar todas como lidas
          </button>
        )}
      </div>

      {/* Notificações List */}
      <div className="space-y-4">
        {userNotificacoes.map(notificacao => (
          <div
            key={notificacao.id}
            className={`bg-white dark:bg-gray-800 rounded-lg shadow-md p-4 border-l-4 ${
              notificacao.lida 
                ? 'border-gray-300 dark:border-gray-600' 
                : 'border-blue-500 bg-blue-50 dark:bg-blue-900/10'
            } border border-gray-200 dark:border-gray-700`}
          >
            <div className="flex items-start justify-between">
              <div className="flex-1">
                <div className="flex items-center gap-2 mb-2">
                  <Bell className={`w-5 h-5 ${notificacao.lida ? 'text-gray-400' : 'text-blue-600'}`} />
                  <h3 className={`font-semibold ${
                    notificacao.lida 
                      ? 'text-gray-700 dark:text-gray-300' 
                      : 'text-gray-900 dark:text-white'
                  }`}>
                    {notificacao.titulo}
                  </h3>
                  {!notificacao.lida && (
                    <span className="bg-blue-600 text-white text-xs px-2 py-1 rounded-full">
                      Nova
                    </span>
                  )}
                </div>
                <p className={`text-sm mb-3 ${
                  notificacao.lida 
                    ? 'text-gray-600 dark:text-gray-400' 
                    : 'text-gray-800 dark:text-gray-200'
                }`}>
                  {notificacao.descricao}
                </p>
                <div className="flex items-center justify-between">
                  <span className="text-xs text-gray-500 dark:text-gray-500">
                    {formatDate(notificacao.data)}
                  </span>
                  <div className="flex gap-2">
                    {notificacao.link && (
                      <a
                        href={notificacao.link}
                        target="_blank"
                        rel="noopener noreferrer"
                        className="text-blue-600 hover:text-blue-700 transition-colors"
                      >
                        <ExternalLink className="w-4 h-4" />
                      </a>
                    )}
                    {!notificacao.lida && (
                      <button
                        onClick={() => markAsRead(notificacao.id)}
                        className="text-blue-600 hover:text-blue-700 transition-colors text-xs"
                      >
                        Marcar como lida
                      </button>
                    )}
                  </div>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>

      {userNotificacoes.length === 0 && (
        <div className="text-center py-12">
          <Bell className="w-16 h-16 text-gray-300 dark:text-gray-600 mx-auto mb-4" />
          <p className="text-gray-500 dark:text-gray-400">Nenhuma notificação encontrada.</p>
          <p className="text-sm text-gray-400 dark:text-gray-500 mt-2">
            As notificações do administrador aparecerão aqui.
          </p>
        </div>
      )}
    </div>
  );
};

export default NotificacoesModule;